import React from "react";

const ImagenCard = () => {
  return (
    <div style={styles.container}>
      <img src={require("./imgs/coffee1.jpeg").default} />
    </div>
  );
};

const styles = {
  container: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
};

export default ImagenCard;
